import { useState } from 'react';
import styled from '@emotion/styled';
import { motion } from 'framer-motion';

const ContactContainer = styled.div`
  padding: 120px 20px 60px;
  max-width: 1200px;
  margin: 0 auto;
`;

const ContactGrid = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 60px;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const ContactInfo = styled.div`
  h2 {
    color: #FF6B35;
    font-size: 36px;
    margin-bottom: 20px;
  }

  p {
    color: ${props => props.isDark ? '#ffffff' : '#666'};
    line-height: 1.6;
    margin-bottom: 30px;
  }
`;

const ContactDetails = styled.div`
  margin-top: 40px;
`;

const DetailItem = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 20px;

  i {
    color: #FF6B35;
    font-size: 24px;
    margin-right: 15px;
  }

  span {
    color: ${props => props.isDark ? '#ffffff' : '#333'};
  }
`;

const ContactForm = styled.form`
  background: ${props => props.isDark ? '#1f1f1f' : 'white'};
  padding: 40px;
  border-radius: 15px;
  box-shadow: 0 4px 16px rgba(255, 107, 53, 0.1);
`;

const FormGroup = styled.div`
  margin-bottom: 20px;
`;

const Label = styled.label`
  display: block;
  margin-bottom: 8px;
  color: ${props => props.isDark ? '#ffffff' : '#333'};
`;

const Input = styled.input`
  width: 100%;
  padding: 12px;
  border: 2px solid ${props => props.isDark ? '#333' : '#ddd'};
  border-radius: 8px;
  background: ${props => props.isDark ? '#121212' : 'white'};
  color: ${props => props.isDark ? '#ffffff' : '#333'};

  &:focus {
    border-color: #FF6B35;
    outline: none;
  }
`;

const TextArea = styled.textarea`
  width: 100%;
  padding: 12px;
  border: 2px solid ${props => props.isDark ? '#333' : '#ddd'};
  border-radius: 8px;
  min-height: 150px;
  background: ${props => props.isDark ? '#121212' : 'white'};
  color: ${props => props.isDark ? '#ffffff' : '#333'};

  &:focus {
    border-color: #FF6B35;
    outline: none;
  }
`;

const SubmitButton = styled.button`
  background: #FF6B35;
  color: white;
  padding: 12px 30px;
  border: none;
  border-radius: 25px;
  cursor: pointer;
  font-size: 16px;
  transition: all 0.3s ease;

  &:hover {
    background: #FF8B55;
    transform: translateY(-2px);
  }
`;

const SuccessMessage = styled(motion.div)`
  background: #4CAF50;
  color: white;
  padding: 15px;
  border-radius: 8px;
  margin-top: 20px;
  text-align: center;
`;

function Contact({ isDark }) {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });
  const [showSuccess, setShowSuccess] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    setShowSuccess(true);
    setTimeout(() => setShowSuccess(false), 3000);
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <ContactContainer>
      <ContactGrid>
        <ContactInfo isDark={isDark}>
          <h2>Get in Touch</h2>
          <p>Ready to capture your special moments? Let's discuss your photography needs.</p>

          <ContactDetails>
            <DetailItem isDark={isDark}>
              <i className="fas fa-map-marker-alt"></i>
              <span>123 Photography Street, City, Country</span>
            </DetailItem>
            <DetailItem isDark={isDark}>
              <i className="fas fa-phone"></i>
              <span>+1 234 567 890</span>
            </DetailItem>
            <DetailItem isDark={isDark}>
              <i className="fas fa-envelope"></i>
              <span>contact@thrumylens.com</span>
            </DetailItem>
          </ContactDetails>
        </ContactInfo>

        <ContactForm onSubmit={handleSubmit} isDark={isDark}>
          <FormGroup>
            <Label isDark={isDark}>Name</Label>
            <Input 
              type="text" 
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
              isDark={isDark}
            />
          </FormGroup>

          <FormGroup>
            <Label isDark={isDark}>Email</Label>
            <Input 
              type="email" 
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
              isDark={isDark}
            />
          </FormGroup>

          <FormGroup>
            <Label isDark={isDark}>Subject</Label>
            <Input 
              type="text" 
              name="subject"
              value={formData.subject}
              onChange={handleChange}
              required
              isDark={isDark}
            />
          </FormGroup>

          <FormGroup>
            <Label isDark={isDark}>Message</Label>
            <TextArea 
              name="message"
              value={formData.message}
              onChange={handleChange}
              required
              isDark={isDark}
            />
          </FormGroup>

          <SubmitButton type="submit">Send Message</SubmitButton>

          {showSuccess && (
            <SuccessMessage
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              exit={{ opacity: 0 }}
            >
              Message sent successfully!
            </SuccessMessage>
          )}
        </ContactForm>
      </ContactGrid>
    </ContactContainer>
  );
}

export default Contact;
